using Cosmos.System.Graphics;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace Quantum.Drawing
{
    class Logo
    {
        private static string b64logo = "";

        public static void Show()
        {
            Kernel.print($@"
  
 
 
  
              Quantum Operating System
              v{ Kernel.version }
");
            try
            {
                Bitmap bitmap = new Bitmap(Convert.FromBase64String(b64logo));
                Kernel.AConsole.DrawImage(100, 100, bitmap);
            } catch (Exception e)
            {
                Kernel.err("Unable to load logo: " + e.ToString());
            }
        }
    }
}
